CREATE TABLE `facturas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_pedido` int(11) NOT NULL,
  `numero` varchar(20) COLLATE latin1_spanish_ci NOT NULL,
  `codigo` varchar(10) COLLATE latin1_spanish_ci NOT NULL,
  `numero_pedido` varchar(20) COLLATE latin1_spanish_ci NOT NULL,
  `numero_albaran` varchar(20) COLLATE latin1_spanish_ci NOT NULL,
  `fecha` date NOT NULL,
  `iva` int(11) NOT NULL,
  `id_cliente` int(11) NOT NULL,
  `id_cliente_direccion_envio` int(11) NOT NULL,
  `numero_cuenta` varchar(50) COLLATE latin1_spanish_ci NOT NULL,
  `obra` varchar(255) COLLATE latin1_spanish_ci NOT NULL,
  `porcentaje_retencion` int(11) NOT NULL,
  `tipo_retencion` set('con_iva','sin_iva') COLLATE latin1_spanish_ci NOT NULL,
  `factura_en_origen` tinyint(4) NOT NULL,
  `factura_en_dolares` tinyint(4) NOT NULL,
  `factura_sin_iva` tinyint(4) NOT NULL,
  `factura_proforma` tinyint(4) NOT NULL,
  `es_abono` tinyint(4) NOT NULL,
  `su_referencia` varchar(20) COLLATE latin1_spanish_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=256 DEFAULT CHARSET=latin1 COLLATE=latin1_spanish_ci;
