CREATE TABLE `ofertas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `numero` varchar(25) COLLATE latin1_spanish_ci NOT NULL,
  `codigo` varchar(25) COLLATE latin1_spanish_ci NOT NULL,
  `departamento` varchar(1) COLLATE latin1_spanish_ci NOT NULL,
  `obra` mediumtext COLLATE latin1_spanish_ci NOT NULL,
  `fecha_recepcion` date NOT NULL,
  `condiciones_pago` varchar(255) COLLATE latin1_spanish_ci NOT NULL,
  `plazo_entrega` varchar(255) COLLATE latin1_spanish_ci NOT NULL,
  `embalaje` varchar(255) COLLATE latin1_spanish_ci NOT NULL,
  `fecha_envio` date NOT NULL,
  `mercancia_franco` varchar(255) COLLATE latin1_spanish_ci NOT NULL,
  `validez_oferta` varchar(255) COLLATE latin1_spanish_ci NOT NULL,
  `tipo` varchar(255) COLLATE latin1_spanish_ci NOT NULL,
  `situacion` varchar(255) COLLATE latin1_spanish_ci NOT NULL,
  `descuento` int(11) NOT NULL,
  `iva` int(11) NOT NULL,
  `id_cliente` int(11) NOT NULL,
  `id_contacto` int(11) NOT NULL,
  `extra` varchar(15) COLLATE latin1_spanish_ci NOT NULL,
  `tipo_oferta` set('','rev','mof','rmo') COLLATE latin1_spanish_ci NOT NULL,
  PRIMARY KEY (`id`),
  KEY `numero` (`numero`),
  KEY `obra` (`obra`(255))
) ENGINE=MyISAM AUTO_INCREMENT=847 DEFAULT CHARSET=latin1 COLLATE=latin1_spanish_ci;
